It says Mixed Media because it's a Wave 6 game, and you most probably have a flashed xbox 360 which only runs games up to Wave 4 or 3. 
Therefore, you need the Activate ISO cd, and burn it to a Dual Layer disc and put it in to the Xbox 360 before you put in the Fifa 11 Demo dvd.

